import { Contact } from './page';

ReactDOM.render(
  <React.StrictMode>
    {/* <ThemeContext.Provider value={themes.dark}> */}
    <App />
   <Contact/>
    {/* </ThemeContext.Provider> */}
  </React.StrictMode>,
  document.getElementById('root')
);

